import styled from "styled-components";

const Style = styled.div`
background : black;
.head {
    padding: 40px 140px;
    img {
        width: 10%;
    }
    .headTitle {
        text-transform: uppercase;
        font-family: "Poppins", sans-serif;
        font-weight: 600;
        line-height: 14px;
        font-size: 12px;
        color: white;
        margin: 0;
        padding: 0;
    }
}
.body {
    .bodyTitle {
        text-transform: uppercase;
        font-family: "Armino", sans-serif;
        font-weight: 600;
        line-height: 14px;
        font-size: 12px;
        color: white;
        margin: 0;
        padding: 0;
    }
}
`;

export default Style;
